description:
Category HD - Shot In High Def, Feature, Straight, Star-Power, 2011 AVN Award Winner 

Director William H. 

Starring Julia Ann, Alexis Texas, Kristina Rose, Jenna Haze, Tori Black, Kagney Linn Karter, Bobbi Starr 


Description

Adult entertainment studio, Elegant Angel, is releasing the latest volume of its annual series, &quot;Performers Of The Year 2010.&quot; The movie is a 2-Disc Set, featuring 7 scenes, and starring the biggest names of the year: Tori Black, Kristina Rose, Jenna Haze, Julia Ann, Kagney Linn Karter, Bobbi Starr, and &quot;Buttwoman&quot; Alexis Texas. 


Format                                   : AVI
Codec ID                                 : XVID
Bit rate                                 : 1 272 Kbps
Width                                    : 576 pixels
Height                                   : 320 pixels


